import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import About from './pages/About';
import Artists from './pages/Artists';
import Booking from './pages/Booking';
import Contact from './pages/Contact';
import Login from './pages/Login';
import Register from './pages/Register';
import PrivateRoute from './components/PrivateRoute';
import AdminLayout from './components/AdminLayout';
import ManageArtists from './pages/admin/ManageArtists'; // Admin-specific page
import ManageBookings from './pages/admin/ManageBookings'; // Admin-specific page

function App() {
    return (
        <AuthProvider>
            <Router>
                <Routes>
                    {/* Public Routes */}
                    <Route
                        path="/"
                        element={
                            <>
                                <Navbar />
                                <Home />
                            </>
                        }
                    />
                    <Route
                        path="/about"
                        element={
                            <>
                                <Navbar />
                                <About />
                            </>
                        }
                    />
                    <Route
                        path="/artists"
                        element={
                            <>
                                <Navbar />
                                <Artists />
                            </>
                        }
                    />
                    <Route
                        path="/booking"
                        element={
                            <>
                                <Navbar />
                                <Booking />
                            </>
                        }
                    />
                    <Route
                        path="/contact"
                        element={
                            <>
                                <Navbar />
                                <Contact />
                            </>
                        }
                    />
                    <Route
                        path="/login"
                        element={
                            <>
                                <Navbar />
                                <Login />
                            </>
                        }
                    />
                    <Route
                        path="/register"
                        element={
                            <>
                                <Navbar />
                                <Register />
                            </>
                        }
                    />

                    {/* Admin Routes */}
                    <Route
                        path="/admin"
                        element={
                            <PrivateRoute isAdminOnly={true}>
                                <AdminLayout>
                                    <ManageArtists /> {/* Default admin page */}
                                </AdminLayout>
                            </PrivateRoute>
                        }
                    />
                    <Route
                        path="/admin/artists"
                        element={
                            <PrivateRoute isAdminOnly={true}>
                                <AdminLayout>
                                    <ManageArtists />
                                </AdminLayout>
                            </PrivateRoute>
                        }
                    />
                    <Route
                        path="/admin/bookings"
                        element={
                            <PrivateRoute isAdminOnly={true}>
                                <AdminLayout>
                                    <ManageBookings />
                                </AdminLayout>
                            </PrivateRoute>
                        }
                    />
                    <Route
    path="/admin/add-artist"
    element={
        <PrivateRoute isAdminOnly={true}>
            <AdminLayout>
                <AddArtist />
            </AdminLayout>
        </PrivateRoute>
    }
/>
                </Routes>
            </Router>
        </AuthProvider>
    );
}

export default App;
